import React from 'react';
import { useParams } from 'react-router-dom';

function RestaurantDetails() {
    const { restaurantId } = useParams(); // This hook extracts the 'restaurantId' parameter from the URL

    return (
        <div>
            <h1>Restaurant Details Page</h1>
            <p>Now showing restaurant details for ID: {restaurantId}</p>
        </div>
    );
}

export default RestaurantDetails;
